import { arr } from "./dataArray";



export default function Video(){
    return(
        <div className="GridFrame">
           {

               arr.map(function(item){
                   return(
                        <div className="Card">
                        {<img src={item.image} height="145px" width="258px"/> }
                        <div className="title">
                        {<img className="roundedAvatar"  src={item.avatar} height="30px" width="30px"/> }
                        {item.name}
                        {<i class="fa fa-clock cursor"></i>}
{
    <iframe width="727" height="14" src="https://www.youtube.com/embed/zw48SrGcTwQ" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
}
                        </div>
                        </div>


                       
                   );
               })
           }
    
        

        </div>
    );
}
